#include <iostream>

using namespace std;

class Solution {
public:
    int maxTotalFruits(vector<vector<int>>& fruits, int startPos, int k) {
        int max = 0;
        int count = 0;
        // filter any point you can reach
        vector<vector<int>> accessFr;
        for (vector<int> f: fruits)
            if (f[0] >= startPos - k && f[0] <= startPos + k)
                accessFr.push_back(f);
        if (accessFr.size() == 0)
            return 0;
        if (accessFr.size() == 1)
            return accessFr[0][1];
        // check all left and all right
        vector<vector<int>>::iterator firstLeft = accessFr.begin() - 1;
        for (vector<vector<int>>::iterator itr = accessFr.begin(); itr != accessFr.end() ; itr++) {
            if ((*itr)[0] > startPos && itr == accessFr.begin()){
                count += (*itr)[1];
                continue;
            }
            if ((*itr)[0] == startPos || (*itr)[0] > startPos && (*(itr-1))[0] < startPos) {
                firstLeft = itr - 1 ;

                max = count;
                if ((*itr)[0] == startPos) {
                    max += (*itr)[1];
                    firstLeft = itr;
                }              
                count = 0;
            }
            count += (*itr)[1];
        }
        if (count > max)
            max = count;
        // all access on one side (all to left or to right from start)
        if (firstLeft == accessFr.begin() - 1 || firstLeft == accessFr.end() - 1)
            return max;
        // check every "go to i-th point to left and then right" and opposite for right and left
        for (vector<vector<int>>::iterator itr = firstLeft; startPos - (*itr)[0] <= k / 3; itr--) {
            int j = 0;
            count = 0;
            while ((*(itr + j))[0] <= startPos + k - (2 * (startPos - (*itr)[0]))) {
                count += (*(itr + j++))[1];
                if (itr + j == accessFr.end())
                    break;
            }
            if (count > max)
                max = count;
            if (itr == accessFr.begin())
                break;
        }
        for (vector<vector<int>>::iterator itr = firstLeft + 1; (*itr)[0] - startPos <= k / 3; itr++) {
            int j = 0;
            count = 0;
            while ((*(itr - j))[0] >= startPos - k + (2 * ((*itr)[0] - startPos))) {
                count += (*(itr - j++))[1];
                if (itr - j == accessFr.begin() - 1)
                    break;
            }
            if (count > max)
                max = count;
            if (itr == accessFr.end() - 1)
                break;
        }
        return max;
    }
};

